var title_f0_39_637="Adult coma evaluation and treatment";
var content_f0_39_637=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F51676&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F51676&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Emergent evaluation and management of stupor and coma in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        EVALUATION",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vital signs and general examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic examination and GCS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Screening laboratories (CBC, glucose selectrolyes, BUN, creatinine, PT, PTT, ABG, LFTs, drug screen)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ECG",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Head CT scan: prioritize emergent if focal neurologic signs, papilledema, fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lumbar puncture: prioritize emergent after CT scan if fever, elevated WBC, meningismus; otherwise do according to level of suspicion for diagnosis or if cause remains obscure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        EEG: for possible nonconvulsive seizure, or if diagnosis remains obscure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other laboratory tests: blood cultures, adrenal and thyroid tests, coagulation tests, carboxyhemoglobin, specific drug concentrations - do according to level of suspicion for diagnosis or if cause remains obscure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Brain MRI with DWI, if cause remains obscure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        MANAGEMENT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        ABCs:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intubate if GCS &le;8",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stabilize CSpine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Supplement O2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        IV access",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blood pressure support as needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Glucose 50 percent IV 50 mL (after blood drawn, before results back)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Thiamine 100 mg IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Treat definite seizures with phenytoin or equivalent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Consider empiric treatments:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        For possible infection:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Ceftriaxone and Vancomycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Acyclovir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        For possible ingestion:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Naloxone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Flumazenil",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Gastric lavage/activated charcoal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        For possible increased ICP:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Mannitol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        For possible nonconvulsive status:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Lorazepam",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Phenytoin or equivalent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     GCS: Glasgow coma scale; CBC: complete blood count; BUN: blood urea nitrogen; PT: prothrombin time; PTT: partial thromboplastin time; ABG: arterial blood gas; LFT: liver function tests; ECG: electrocardiogram; CT: computed tomography; WBC: white blood cells; EEG: electroencephalography; MRI: magnetic resonance imaging; DWI: diffusion weighted imaging; ICP: intracranial pressure.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
