var title_f0_39_638="Molecular tests for meningitis";
var content_f0_39_638=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F58078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F58078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Molecular tests for meningitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Etiology",
"       </td>",
"       <td class=\"subtitle1\">",
"        Availability*",
"       </td>",
"       <td class=\"subtitle1\">",
"        When inclusion of NAAT is indicated",
"       </td>",
"       <td class=\"subtitle1\">",
"        Preferred testing method(s)&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Common pathogens (eg, Streptococcus pneumoniae, Haemophilus influenzae)",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Gram's stain positive, culture negative; prior antibacterial therapy",
"       </td>",
"       <td>",
"        Gram's stain; culture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fastidious (Mycoplasma spp, Tropheryma spp, Brucella spp)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        Serology, NAAT +/- culture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mycobacterium tuberculosis&Delta;",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Occasionally",
"       </td>",
"       <td>",
"        AFB stain, culture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prior antibiotic therapy&loz;",
"       </td>",
"       <td>",
"        Investigational",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Culture prior to antibacterial therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Viruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Adenoviruses",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Testing of alternative sites (eg, respiratory) +/- CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Arboviruses",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cytomegalovirus (CMV)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        NAAT, preferably quantitative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Epstein Barr Virus (EBV)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        Serology and NAAT, preferably quantitative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Enteroviruses",
"       </td>",
"       <td>",
"        Widespread",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        NAAT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Human herpesvirus 6 (HHV-6)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        NAAT, preferably quantitative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Herpes simplex virus (HSV)",
"       </td>",
"       <td>",
"        Widespread",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        NAAT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Influenza",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Testing of alternative sites (eg, respiratory) +/- CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymphocytic choriomeningitis virus (LCMV)",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mumps",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Viral culture, serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Parechoviruses&sect;",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        NAAT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Varicella zoster virus (VZV)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        When clinically suspected",
"       </td>",
"       <td>",
"        NAAT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        West Nile virus&yen;",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Rarely (unless immunodeficient)",
"       </td>",
"       <td>",
"        Serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Rickettsia������",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Occasionally",
"       </td>",
"       <td>",
"        Serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Spirochetes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Leptospira",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Borrelia burgdorferi (Lyme)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Serology, NAAT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Treponema pallidum (syphilis)",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Serology, CSF VDRL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Fungal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cryptococcus spp",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Antigen detection, culture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Other fungi (eg, Coccidioides spp)",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Culture, serology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Parasites",
"       </td>",
"       <td>",
"        Limited",
"       </td>",
"       <td>",
"        Rarely",
"       </td>",
"       <td>",
"        Serology, histologic exam",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PPV: positive predictive value; PCR: polymerase chain reaction; CDC: Centers for Disease Control and Prevention; NAAT: nucleic acid amplification testing; CSF: cerebrospinal fluid; AFB: acid fast bacilli.",
"     <br>",
"      * Widespread: readily available; Yes: consistently available, but not yet common; Limited: one or two specialized laboratories (eg, Centers for Disease Control and Prevention (CDC) or research groups).",
"      <br>",
"       &bull; Test on CSF except where noted.",
"       <br>",
"        &Delta; Poor sensitivity, high PPV, rapid.",
"        <br>",
"         &loz; 16s rDNA \"Universal\" PCR.",
"         <br>",
"          &sect; Not detected by most enterovirus assays.",
"          <br>",
"           &yen; Virus is usually cleared from blood and CSF prior to symptom onset.",
"           <br>",
"            &Dagger; Limited experience from CSF.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
